import './App.css';

function App() {
  return (
    <div className="App">
    <form>
        <div>Lorum Ipsem Lorum Ipsem Lorum Ipsem</div>

        <div>Investment Amount: <input type="number" min="0.01" step="0.01" value="123.45" onChange={this.handleChange}/></div>

        <div>Investment Type: <input type="text" name="type" value="Stocks"/></div>

        <div>Total Net Worth <input type="number" min="0.01" step="0.01" value="123.45" /></div>

        <div>User Estimated Yearly Income <input type="number" min="0.01" step="0.01" value="123.45" /></div>

        <div>User Estimated Credit Score <input type="number" min="300" max="850" step="1" value="123.45" /></div>

        <input type="submit" value="Submit" />

    </form>
    </div>
  );
}

export default App;
